/**
 * Import AddMovieForm module css
 */

import styles from "./AddMovieForm.module.css";

// membuat komponen add movie form

const AddMovieForm = () => {
  return (
    <div className={styles.container}>
      <section className={styles.addmovieform}>
        <div className={styles.addmovieform__left}>
          <img
            className={styles.addmovieform__img}
            src="https://images.alphacoders.com/548/thumb-1920-548564.jpg"
            alt="placeholder"
          />
        </div>
        <div className={styles.addmovieform__right}>
          <h2>Add Movie</h2>
          <div>
            <label htmlFor="title">Title</label>
            <input
              type="text"
              name="title"
              className={styles.addmovieform__inputTitle}
            />
          </div>
          <div>
            <label htmlFor="year">Year</label>
            <input
              type="text"
              name="year"
              className={styles.addmovieform__inputYear}
            />
          </div>
        </div>
      </section>
    </div>
  );
};

export default AddMovieForm;
